INSERT INTO `metadata` VALUES ('Percentage value is a comparison of 2050 emission target vs. actual 2005 emissions. Other developing countries includes smaller developing nations in the Middle East, Latin America, Africa, and Asia.',248,'D_Pct change in Developing B FF emissions','Other developing countries emissions change','java.lang.Double','RANGE','Percentage of 2005 emissions','Fossil Fuel Emissions Change',NULL,'SCALAR',NULL),('Percentage value is a comparison of 2050 emission target vs. actual 2005 emissions. Developed countries includes many of the most developed nations: US, EU (27 countries), Norway and Sweden, Russia and the former Soviet States, Japan, Canada, South Korea, New Zealand, and Australia.',243,'D_Pct change in Developed FF emissions','Developed countries emissions change','java.lang.Double','RANGE','Percentage of 2005 emissions','Fossil Fuel Emissions Change',NULL,'SCALAR',NULL),('Amount of emissions per year for developed countries including US, EU (27 countries), Russia and former Soviet States, Japan, Canada, South Korea, and Australia.',242,'DevelopedFossilFuelEmissions','Developed countries Fossil Fuel Emissions','java.lang.Double','RANGE','10^9 tons of Carbon','Fossil Fuel Emissions',NULL,'INDEXED',271),('This value is a 0-to-1 index for the annual removal of CO2 from the atmosphere due to the creation of new forests, starting in 2009 and continuing until 2050. A value of 1 delivers the IPCC estimated maximum of 1.6 billion tons of carbon removed per year, while 0.5 delivers half of the maximum, and 0 means no increase.',244,'D_Target Sequestration','Sequestration due to Treegrowth','java.lang.Double','RANGE','Fraction of max removal','Afforestation',NULL,'SCALAR',NULL),('This value is a measure of deforestation and resulting CO2 land use emissions. It value is a 0-to-1 index where a value of 1 yields constant emissions through 2050, 0.5 yields a drop of 45% by 2050, and 0 yields a 90% drop by 2050.',240,'D_Global land use emissions cha