INSERT INTO `simulation` VALUES ('The Climate Interactive Simulation is a lightweight GHG model, written in the Vensim simulation language, and developed by researchers from the Sustainability Institute and Rocky Mountain Institute. Although it is lightweight enough to be run on a personal computer, its results are consistent with much larger models, including the MiniCam and Merge models.  The web-based version of the model is hosted at the <a href=\'http://forio.com/simulation/international-climate-change-simulation/\'>Forio</a> website.',240,'Climate Interactive Simulation','http://localhost:8080/pangaea-servlet/rest/','PUBLIC','2009-08-30 23:02:33',NULL),('',583,'IGSM','http://localhost:8080/excel_wrapper-servlet/rest/wrapper/961','PUBLIC','2009-09-10 00:47:27',NULL),('',584,'MERGE','http://localhost:8080/excel_wrapper-servlet/rest/wrapper/962','PUBLIC','2009-09-10 00:47:52',NULL),('',585,'MiniCAM','http://localhost:8080/excel_wrapper-servlet/rest/wrapper/963','PUBLIC','2009-09-10 00:48:16',NULL),('',586,'DICE','http://localhost:8080/excel_wrapper-servlet/rest/wrapper/964','PUBLIC','2009-09-10 00:48:40',NULL),('',587,'PAGE','http://localhost:8080/excel_wrapper-servlet/rest/wrapper/965','PUBLIC','2009-09-10 00:49:00',NULL),('',588,'STERN','http://localhost:8080/excel_wrapper-servlet/rest/wrapper/966','PUBLIC','2009-09-10 00:49:32',NULL),('',589,'Composite',NULL,'PUBLIC','2009-09-10 01:02:01','<?xml version=\"1.0\" encoding=\"UTF-8\" standalone=\"no\"?><root><inputs><simulation id=\"240\"/></inputs><step><simulation id=\"240\"/></step><step><simulation id=\"586\"><input internalname=\"Temperature\" map=\"all\" source=\"240.GlobalTempChange\"/></simulation><simulation id=\"587\"><input internalname=\"Temperature\" map=\"all\" source=\"240.GlobalTempChange\"/></simulation><simulation id=\"583\"><input internalname=\"Atmospheric_CO2_concentration\" map=\"all\" source=\"240.AtmosphericCO2Concentration\"/><input internalname=\"Time\" interval=\"10\" map=\"some\" source